                    <div className="characterName">{tailedBeastsItem.name}</div>
                    <div className="characterImage"><img src={tailedBeastsItem.images[0]} alt="React Image" /></div>


                </div>
            ))}
        </div>
    </div>
  )
}

export default TailedBeasts
